import React, { Fragment } from 'react';

export const BrandCard = () => {
  return (
    <Fragment>
      <div className='swiper-slide'>
        <div className='brandbox'>
          <img src='image/brands/Realme.png' className='img-fluid' />
          {/* <p class="pname">Realme</p> */}
        </div>
      </div>
    </Fragment>
  );
};
